import React from 'react'

let Users = (props) => {
    console.log(props)

    let followAC = (id) => {
        props.followAC(id)
    }
    let unfollowAC = (id) => {
        props.unfollowAC(id)
    }

    return (
        <div>
            <div>
                <div></div>
                <button onClick={followAC}>Follow</button>
                <button onClick={unfollowAC}>Unfollow</button>
            </div>
            <div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
            </div>
        </div>
    )
}

export default Users
